import React from 'react'
import './App.css';
import Task from './components/Task'
import TaskList from './components/TaskList'

const tasks = [
  {
    title: "Learn Flask",
    content: "make an api",
  },
  {
    title: "Review React",
    content: "make a tasklist front end",
  },
  {
    title: "Ada Build",
    content: "make video lessons",
  },
  {
    fullName: "",
    content: "make a tasklist front end",
  },
];


function App() {
  return (
    <div className="App">
      <TaskList tasks={tasks}/>
    </div>
  );
}

export default App;
